	
ESX = nil
local playersProcessingStones = {}

TriggerEvent('esx:getSharedObject', function(obj) ESX = obj end)

RegisterServerEvent('exodus_mango:pickedUpwoods')
AddEventHandler('exodus_mango:pickedUpwoods', function()
	local xPlayer = ESX.GetPlayerFromId(source)
	local xItem = xPlayer.getInventoryItem('mango')
	math.randomseed(GetGameTimer())

	if xItem.limit ~= -1 and (xItem.count + 1) > xItem.limit then
		TriggerClientEvent('mythic_notify:client:SendAlert', source, { type = 'error', text = 'Inventoryfull', length = 2500, style = { ['background-color'] = '#ffffff', ['color'] = '#000000' } })
	else
		UserAvatar = ''
		mensahe = 'Player **'..xPlayer.name..'** Farm 1 mango '
		PerformHttpRequest('', 
		function(err, text, headers) end, 'POST', json.encode({username = 'Nexus Development' ,content = mensahe,  avatar_url = UserAvatar}), { ['Content-Type'] = 'application/json' })

		xPlayer.addInventoryItem(xItem.name, 1)
	end
end)


RegisterServerEvent('exodus_mango:pack')
AddEventHandler('exodus_mango:pack', function()
	local xPlayer = ESX.GetPlayerFromId(source)


	xPlayer.removeInventoryItem('mango', 1)
	xPlayer.addInventoryItem('mangop', 1)

end)

RegisterServerEvent('exodus_mango:Sellpack')

AddEventHandler('exodus_mango:Sellpack', function()
	--[[local xPlayer = ESX.GetPlayerFromId(source)
	xPlayer.removeInventoryItem('fresh_shellfish', 1)
	xPlayer.addMoney(Config.Price)--]]

	local xPlayer = ESX.GetPlayerFromId(source)
	local xItem = xPlayer.getInventoryItem('mangop')

	xPlayer.removeInventoryItem('mangop', xItem.count)
	xPlayer.addMoney(Config.Price * xItem.count)

end)

RegisterServerEvent('exodus_mango:CheackingPack')
AddEventHandler('exodus_mango:CheackingPack', function()
	local xPlayer = ESX.GetPlayerFromId(source)
	local xItem = xPlayer.getInventoryItem('mango')

	if xItem.count > 1 then
	TriggerClientEvent('exodus_mango:CheackingOK', source)

	end




end)


RegisterServerEvent('exodus_mango:CheackingPack')
AddEventHandler('exodus_mango:CheackingPack', function()
	local xPlayer = ESX.GetPlayerFromId(source)
	local xItem = xPlayer.getInventoryItem('mango')

	if xItem.count > 0 then



	TriggerClientEvent('exodus_mango:CheackingOK', source)

	end




end)

RegisterServerEvent('exodus_mango:SellCheak')
AddEventHandler('exodus_mango:SellCheak', function()

	local xPlayer = ESX.GetPlayerFromId(source)
	local xItem = xPlayer.getInventoryItem('mangop')

	if xItem.count > 0 then
	TriggerClientEvent('exodus_mango:CheackingSellOK', source)

	end


end)

ESX.RegisterServerCallback('exodus_mango:canPickUp', function(source, cb, item)
	local xPlayer = ESX.GetPlayerFromId(source)
	local xItem = xPlayer.getInventoryItem(item)

	if xItem.limit ~= -1 and xItem.count >= xItem.limit then
		cb(false)
	else
		cb(true)
	end
end)



function CancelProcessing(playerID)
	if playersProcessingStones[playerID] then
		ESX.ClearTimeout(playersProcessingStones[playerID])
		playersProcessingStones[playerID] = nil
	end
end

RegisterServerEvent('exodus_mango:cancelProcessing')
AddEventHandler('exodus_mango:cancelProcessing', function()
	CancelProcessing(source)
end)

AddEventHandler('esx:playerDropped', function(playerID, reason)
	CancelProcessing(playerID)
end)

RegisterServerEvent('esx:onPlayerDeath')
AddEventHandler('esx:onPlayerDeath', function(data)
	CancelProcessing(source)
end)

